import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';
import "./StartingPage.css";
import FlightTakeoffIcon from '@material-ui/icons/FlightTakeoff';
import FlightLandIcon from '@material-ui/icons/FlightLand';
import Grid from '@material-ui/core/Grid';
import { useEffect, useState } from "react";
import SearchResults from './SearchResults';

const cities = [
  "Paris",
  "London"];

function SearchBar(props) {

  const [error, setError] = useState(null);
  const [didLocationsLoad, setDidLocationsLoad] = useState(false);
  const [locationResults, setLocationResults] = useState([]);
  const [airportOptions, setAirportOptions] = useState([]);
  const [searchText, updateSearchText] = useState("");

  useEffect(() => {
      fetch("http://localhost:8080/getLocation/" + searchText)
          .then(res => res.json())
          .then(
              (result) => {
                  setDidLocationsLoad(true);
                  setLocationResults(result.map(place => place.PlaceName));
              },
              // Note: it's important to handle errors here
              // instead of a catch() block so that we don't swallow
              // exceptions from actual bugs in components.
              (error) => {
                  setDidLocationsLoad(true);
                  setError(error);
              }
          )
  }, [])

  // if (error) {
  //     setAirportOptions(["Nothing found, enter a city name..."]);
  //     return <div style={{color: "white"}}>No results found (try a city name).</div>;
  //   } else if (!didLocationsLoad) {
  //     setAirportOptions(["Loading"]);
  //     return <div>Loading...</div>;
  //   } else {
  //     {console.log(locationResults)}
  //     setAirportOptions(locationResults);
  //     return (
  //         <div style={{color: "white"}}> Success</div>
  //     );
  //   }




  return <div><Grid container className="searchBar"  justify="center" alignItems="center" direction="row">
    <Grid item>
      {(props.name === "originSearchBar") ? <FlightTakeoffIcon fontSize="large" /> : <FlightLandIcon fontSize="large" />}
    </Grid>
    <Grid item>
      <Autocomplete
        name={props.name}
        id={props.name}
        onInputChange={updateSearchText}
        options={locationResults}
        getOptionLabel={(option) => option}
        style={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label={props.label}/>}

      /></Grid>
      </Grid>
      </div>;
}

export default SearchBar;
